  padding-bottom:40px;
  gap:40px;display: inline-flex;
  flex-wrap: wrap;
margin-auto;
`;


const ArticleList = ({unfeatured}) => {
    return(
        <>
        <CardSection>
         {unfeatured.map((article) => (

        <Card key={article.id} article={article} />

      ))}
      </CardSection>


        </>
    );
}

